import React, { useState, useEffect } from "react";
import {Navbar, Footer} from '../../components/index'

function Home() {
  return (
    <>
      <Navbar />
      <div className="Home">
        <h1>Welcome to [website]</h1>
        <Footer />
      </div>
    </>
  );
}

export default Home;
